  const model = useLocalObservable(() => createModel({
    initialState: {
      isAgreed: false,
      // boolean
      tags: [] as string[] // array
    },
    descriptors: {
      isAgreed: {
        required: 'You must agree to terms',
        // booleans need custom check if "false" is considered "no value"? 
        // default behavior: false is a value. empty string/null/undefined is not.
        // But usually for "Agree" checkbox, false is invalid.
        validator: field => {
          if (field.value !== true) return {
            error: 'Must agree'
          };
        }
      },
      tags: {
        required: 'At least one tag required'
        // Default hasValue for arrays checks length > 0
      }
    }
  }));
  return <FormWrapper model={model} title="Boolean & Array Values" description="Handling checkboxes and array inputs.">
      <FieldInput field={model.fields.isAgreed} label="I Agree to Terms" type="checkbox" />
      
      <div style={{
      marginBottom: 15
    }}>
        <label style={{
        fontWeight: 'bold'
      }}>Tags (comma separated)</label>
        <input style={{
        width: '100%',
        padding: 8
      }} onChange={e => {
        const val = e.target.value.split(',').map(s => s.trim()).filter(Boolean);
        model.fields.tags.setValue(val);
      }} placeholder="Type tags..." />
        <div style={{
        fontSize: 12,
        color: '#666'
      }}>Current tags: {JSON.stringify(model.fields.tags.value)}</div>
        {model.fields.tags.error && <div style={{
        color: 'red'
      }}>{model.fields.tags.error}</div>}
      </div>

      <DebugPanel model={model} />
    </FormWrapper>;
